import React, { Component } from 'react';
import ContactForm from './ContactForm';

class ContactUs extends Component {
    render() {
        return (
            <div id="main">
				<div id="content">
					<section>
						<div className="container">
							<h3>Contact Us</h3>
							<ContactForm />
						</div>
					</section>
				</div>
			</div>
        );
    }
}

export default ContactUs;
